import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './HomePage';


function App() {
  return (
      <Router>
        <Routes>

          <Route exact path="/" component={HomePage} />

      </Routes>
    </Router>
  );
}

export default App;
